import React from 'react';
import LoginForm from './Login'; // Importa el formulario de inicio de sesión
import './LoginPage.css'; // Estilos para esta página

function LoginPage({ onLogin }) {
    const handleLoginSubmit = (data) => {
    // Aquí puedes manejar la lógica para iniciar sesión con los datos del formulario
    console.log('Datos de inicio de sesión:', data);
    // Aquí podrías, por ejemplo, llamar a una función `onLogin` pasada como prop para actualizar el estado de inicio de sesión en tu aplicación
    onLogin();
};
return (
    <div className="login-page">
        <h2>Iniciar sesión</h2>
        <LoginForm onSubmit={handleLoginSubmit} />
      {/* Otros elementos de la página de inicio de sesión */}
    </div>
);
}

export default LoginPage;
